import React from "react";
import Card from "./Card";

const Accordion = (props) => {
  const { items } = props;
  return (
    <div className="accordion" id="accordionExample">
      <Card items={items} type={"Groceries"} />
      <Card items={items} type={"House"} />
      <Card items={items} type={"Car"} />
      <Card items={items} type={"Other"} />
    </div>
  );
};

export default Accordion;
